  XW += x[26] * 41.029000;                 // HCCO
  XW += x[27] * 42.037000;                 // CH2CO
  XW += x[28] * 43.045000;                 // CH3CO
  XW += x[29] * 43.045000;                 // CH2CHO
  XW += x[30] * 44.053000;                 // CH3CHO
  XW += x[31] * 39.057000;                 // C3H3
