  XW += x[35] * 41.073000;                 // CH3CCH2
  XW += x[36] * 42.081000;                 // C3H6
  XW += x[37] * 43.089000;                 // nC3H7
  XW += x[38] * 43.089000;                 // iC3H7
  XW += x[39] * 56.064000;                 // C2H3CHO
  XW += x[40] * 50.060000;                 // C4H2
  XW += x[41] * 51.068000;                 // iC4H3
  XW += x[42] * 52.076000;                 // C4H4
  XW += x[43] * 53.084000;                 // iC4H5
  XW += x[44] * 53.084000;                 // C4H5-2
  XW += x[45] * 54.092000;                 // C4H6
  XW += x[46] * 54.092000;                 // C4H612
  XW += x[47] * 54.092000;                 // C4H6-2
  XW += x[48] * 55.100000;                 // C4H7
  XW += x[49] * 56.108000;                 // C4H81
  XW += x[50] * 57.116000;                 // pC4H9
